import React, { useEffect } from "react";

export const Google_Map = () => {

useEffect(()=>{
    
const Action_Script = document.createElement('script')
Action_Script.src = '../Google_Map_Api/Google_Map_Api_Components/Google_MapApi_Loader.js'
Action_Script.async = true;
document.body.appendChild(Action_Script)

},[])

return <React.Fragment>

<div id='Google_Map'>
</div>

</React.Fragment>

}

export default Google_Map
